import { useState } from 'react';
import { Navigate, Route, Routes } from "react-router-dom";

import { NavBar } from './navBarFolder/navBar';
import { ruteList } from '../data/ruteList';
import { RuteListComponent } from './RouteListFolder/ruteListComponent';
import { NewRuteComponent } from './createRuteFolder/newRuteComponent';
import { CompletedRutesComponent } from './completedRutesComponent';


import '../styles/navBarStyle.css';
import '../styles/homeStyle.css';




export const Home = () => {

  const [ rutesList , setRutesList ] = useState( ruteList() );

  const [ rutesCompleted, setRutesCompleted ] = useState([]);

    
  return (
    <>

    <NavBar/>

    <Routes>

      <Route path = "home" element = { 

        <RuteListComponent  rutesList = { rutesList } 
                            setRutesList = { setRutesList }  
                            rutesCompleted={rutesCompleted} 
                            setRutesCompleted={setRutesCompleted}/> }>

      </Route>



      <Route path = "newRute" element = { 

        <NewRuteComponent   setRutesList = { setRutesList } 
                            rutesList = { rutesList }/> }>

      </Route>



      <Route path = "completed" element = { 

        <CompletedRutesComponent rutesCompleted={rutesCompleted} /> }>

      </Route>


      <Route path = "*" element = { <Navigate to = "home" ></Navigate> }></Route>

    </Routes>
         
    </>
     
  )
}
